#[test]
fn stark_basic_test() {
	new_test_ext().execute_with(|| {
		let program_hash = [86, 19, 112, 170, 96, 203, 166, 50, 126, 168, 223, 166, 46, 82, 230, 57, 178, 156, 31, 24, 251, 15, 176, 177, 202, 167, 191, 132, 254, 243, 180, 176];
		let inputs = Box::new(vec![]);
		let outputs = Box::new(vec![8]);
		let proof = hex::decode("").unwrap();

		assert_ok!(TemplateModule::verify(Origin::signed(1), program_hash, inputs, outputs, proof));
	});
}
